css:
@import 'languages/css';
atom-text-editor {
  background-color: #282c34;
  color: #abb2bf;
}
atom-text-editor .line.cursor-line {
  background-color: rgba(153, 187, 255, 0.04);
}
atom-text-editor .invisible {
  color: #abb2bf;
}
atom-text-editor .cursor {
  border-left: 2px solid #528bff;
}
atom-text-editor .selection .region {
  background-color: #3e4451;
}
atom-text-editor .bracket-matcher .region {
  border-bottom: 1px solid #528bff;
  box-sizing: border-box;
}
atom-text-editor .invisible-character {
  color: rgba(171, 178, 191, 0.3);
}
atom-text-editor .indent-guide {
  color: rgba(171, 178, 191, 0.3);
}
atom-text-editor .wrap-guide {
  background-color: rgba(171, 178, 191, 0.3);
}
atom-text-editor .gutter .line-number {
  color: #636d83;
  -webkit-font-smoothing: antialiased;
}
atom-text-editor .gutter .line-number.cursor-line {
  color: #abb2bf;
  background-color: #3e4451;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection {
  background-color: transparent;
}
atom-text-editor .gutter .line-number .icon-right {
  color: #abb2bf;
}
atom-text-editor .gutter:not(.git-diff-icon) .line-number.git-line-removed.git-line-removed::before {
  bottom: -3px;
}
atom-text-editor .gutter:not(.git-diff-icon) .line-number.git-line-removed::after {
  content: '';
  position: absolute;
  left: 0;
  bottom: 0;
  width: 25px;
  border-bottom: 1px dotted rgba(224, 82, 82, 0.5);
  pointer-events: none;
}
atom-text-editor .fold-marker:after,
atom-text-editor .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after {
  color: #abb2bf;
}
.syntax--comment {
  color: #808080;
}
.syntax--comment.syntax--documentation {
  color: #629755;
}
.syntax--comment.syntax--punctuation.syntax--definition {
  color: inherit;
}
.syntax--keyword.syntax--other.syntax--special-method,
.syntax--keyword:not(.syntax--operator) {
  color: #cc7832;
  font-weight: bold;
}
.syntax--keyword.syntax--operator:not(.syntax--control, .syntax--logical) {
  color: #abb2bf;
  font-weight: normal;
}
.syntax--keyword.syntax--other.syntax--unit {
  color: #6898BB;
  font-weight: normal;
}
.syntax--keyword.syntax--other.syntax--documentation {
  color: #ffc66d;
  font-weight: bold;
  text-decoration: underline;
}
.syntax--storage.syntax--type {
  color: #abb2bf;
  font-weight: bold;
}
.syntax--storage.syntax--type.syntax--annotation {
  color: #BBB529;
  font-weight: normal;
}
.syntax--storage.syntax--class,
.syntax--storage.syntax--extends,
.syntax--storage.syntax--function,
.syntax--storage.syntax--modifier,
.syntax--storage.syntax--type.syntax--primitive,
.syntax--storage.syntax--var {
  color: #cc7832;
  font-weight: bold;
}
.syntax--storage.syntax--modifier.syntax--import,
.syntax--storage.syntax--modifier.syntax--package {
  color: #abb2bf;
  font-weight: normal;
}
.syntax--storage.syntax--todo {
  color: #A8C023;
  font-style: italic;
  font-weight: normal;
}
.syntax--variable {
  color: #abb2bf;
}
.syntax--variable.syntax--language {
  color: #cc7832;
  font-weight: bold;
}
.syntax--variable.syntax--class,
.syntax--variable.syntax--instance,
.syntax--variable.syntax--property {
  color: #9876aa;
}
.syntax--variable.syntax--class {
  color: #9876aa;
}
.syntax--variable.syntax--global {
